import React from 'react';
import {Answer} from './index'


// 関数コンポーネントで作成する

const AnswersList = (props)=>{

  return (
    <div className="c-grid__answer">
      {props.answers.map((value, index) => {
        return <Answer content={value} key={index} />;
      })}
    </div>
  );
}

export default AnswersList
